import React from 'react';
import {Link} from "react-router-dom";
import { useCookies } from 'react-cookie';
import {getRole} from "../extensions/encryption";

const Header = () => {

    const [cookies] = useCookies(['token']);

    return (
        <div className="container-fluid ">
            <div className="row">
                <div className="col-xl-12" style={{backgroundColor: '#2B2D42', boxShadow: '5px 3px 25px black'}}>
                    <div className="row">
                        <div className="offset-xl-3 col-xl-2 col-3 text-start">
                            <Link style={{textDecoration: 'none'}} to="/"><h1 style={{color: 'white'}}>HOME</h1></Link>
                        </div>
                        <div className="col-xl-3 col-10 text-xl-start">
                            <Link style={{textDecoration: 'none'}} to="/addingArticle"><h1 style={{color: 'white'}}>ADD AN ARTICLE</h1></Link>
                        </div>

                        <div className="col-xl-3 col-10 text-xl-start">
                            {getRole() === 'USER' ? (
                                <Link style={{textDecoration: 'none'}} to="/PersonalArea"><h1 style={{color: 'white'}}>PERSONAL AREA</h1></Link>
                            ):(
                                <Link style={{textDecoration: 'none'}} to="/Login"><h1 style={{color: 'white'}}>LOGIN</h1></Link>
                            )}
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Header;
